import React from "react";
import { FormLoginHtml } from "../../login/FormLogin";
import { ButtonsCheck } from "../Buttons/ButtonsPrimary";
import { AuthProvider } from "../context/auth.context";

export const RoutesHtml = () => {
  return (
    <AuthProvider>
      <FormLoginHtml />
      <ButtonsCheck />
    </AuthProvider>
  );
};
